import React, { useState } from 'react'
import { Accordion, AccordionSummary, Tab, Typography } from '@mui/material'
import AccordionDetails from '@mui/material/AccordionDetails';
import Box from '@mui/material/Box';
import Tabs from '@mui/material/Tabs';
import Paper from '@mui/material/Paper';

// import LinkTab 
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';

const HybridGeyser = () => {
    const [value, setValue] =useState(0)

  const handleChange = (event, newValue) =>{
      setValue(newValue)
  };
  return (
    <div>
      <Accordion>
            <AccordionSummary 
            
            expandIcon={<ExpandMoreIcon color="white" />}
            aria-controls="panel1a-content"
            id="panel1a-header"
            sx={{color: 'white',
            background: 'linear-gradient(180deg,#66bb6a 0%, #43a047 100%)' ,height:'10'}}>
            <Typography>Geyser On</Typography>

            </AccordionSummary>
            <AccordionDetails>
            <Box sx={{bgcolor:'background.paper' ,width:"100%" , height:30,
        //   display: 'flex',
        //   justifyContent: 'center',
        //   p: 1,
        //   m: 1,
          bgcolor: 'background.paper',
          borderRadius: 1,
        
        }}>
      
      <Paper sx={{width:"100%  ", display: 'flex',
          justifyContent: 'center',}}>
      <Tabs>
      <Tab
      // value="one"
      label="Overview"
      href ="/Tab1"
      />
    <Tab
      // value="two"
      label="Setting"
      href= "/Tab2"
      />
    
    </Tabs>
    </Paper>
    </Box>

    
    <Paper elevation={0.5} sx={{mt:3}}>hello</Paper>
            </AccordionDetails>

      </Accordion>
      
    </div>
  )
}

export default HybridGeyser
